            <div class="row">
                <div class="col-md-7">
                    <h1 class="ubuntu-medium f-hero mb-4">A Symphony <br> of Solutions</h1>
                    <p class="ubuntu-regular f-paragraf">Our holding company fosters a diverse ecosystem of <br> expertise, empowering businesses and individuals <br> across various sectors.</p>
                    <a href="#contact-us" class="btn btn-primary button-header">Contact Us</a>
